import React from "react";
import CenteredLayout from "../common/centeredLayout";
import { Button, Checkbox, Form, Select, Input, TextArea, Image} from "semantic-ui-react";
import handleSubmit from "react";
import handleChange from "react";
import values from "React";

const genderOptions =[
  {key: "m", text: "male", value:"male"},
  {key: "j", text: "female", value:"female"},
  {key: "k", text: "kale", value: "kale"},
  {key: "o", text: "other", value:"other"},
]


const registerRestaurant = () => (
  //const {handleChange, handleSubmit, values, errors}= useForm(submit, Validate);
  <CenteredLayout>
  <Form onSubmit={handleSubmit}noValidate>
    <Form.Field
     control={Input} label="Nombre del Restaurante" name="NombreRestaurante"
      maxLength="50" placeholder='Nombre del Restaurante'
      value={values, NombreRestaurante}
      onChange={handleChange}
    />
    <Form.Group widths='equal'>
    <Form.Field
      control={Input} label="Dirección del Restaurante" name="DirecciónRestaurante"
      maxLength="50" placeholder='DirecciÓn del Restaurante'
      value={values, DirecciónRestaurante}
      onChange={handleChange}
    />
    <Form.Field
        control={Select}
        options={genderOptions}
        label={{ children: 'Provincia', htmlFor: 'form-select-control-gender' }} name='Provincia'
        placeholder='Provincia'
        search
        searchInput={{ id: 'form-select-control-gender' }}
        value={values, Provincia}
        onChange={handleChange}
    />
    </Form.Group>
    <Form.Group widths='equal'>
    <Form.Field
          control={TextArea} label='Información adicional del restaurante' name="InformaciónAdicional"
          maxLength="50" placeholder='Tell us more about you...'
          value={values, InformaciónAdicional}
          onChange={handleChange}
    />
    <Form.Field
      control={Input} label="Correo Electrónico" name="email"
      maxLength="50" placeholder='Correo Electrónico'
      value={values, email}
      onChange={handleChange}
    />
    </Form.Group>
    <Form.Group widths='equal'>
    <Form.Field
      control={Input} label="Dirección de su sitio web" name="DirecciónWeb" 
      maxLength="50" placeholder='Dirección de su sitio web'
      value={values, DirecciónWeb }
      onChange={handleChange}
    />
    <Form.Field
      control={Input} label="Teléfono" name="Teléfono"
      maxLength="50" placeholder='Teléfono'
      value={values, Teléfono}
      onChange={handleChange}
    />
    </Form.Group>
    <Form.Group widths='equal'>
    <Form.Field
      control={Input} label="Dirección página de publicidad" name="Publicidad" 
      maxLength="50" placeholder='Dirección página de publicidad'
      value={values, Publicidad}
      onChange={handleChange}
    />
    <Form.Field
      control={Input} label="Categoría del Restaurante" name="Categoría"
      maxLength="50" placeholder='Categoría del Restaurante'
      value={values, Categoría}
      onChange={handleChange}
    />
    </Form.Group>
    <Form.Group widths='equal'>
    <Form.Field>
    <label>Fotografía del logo del Restaurante"</label>
    <Image src='https://react.semantic-ui.com/images/wireframe/square-image.png' size='small' circular />
    </Form.Field>
    <Form.Field
      control={TextArea} label="Descripción del Restaurante" name="Descripción"
      maxLength="50" placeholder='Descripción del Restaurante'
      value={values, Descripción}
      onChange={handleChange}
    />
    </Form.Group>
    <Form.Group widths='equal'>
       <Form.Field control={Button}>Cancelar</Form.Field>
       <Form.Field control={submit}>Guardar</Form.Field>
    </Form.Group>
  </Form>
  </CenteredLayout>

)

export default registerRestaurant;
